import NavBar from '@/components/NavBar';
import { List, DatePicker, Space } from 'antd-mobile';
import { useState } from 'react';
import styles from './index.module.scss'

export default function Edit() {
    const [visible, setVisible] = useState(false);
    const [dateValue, setDateValue] = useState();
    console.log(dateValue);
    return (
        <div className={styles.root}>
            <div className='content'>
                {/* 顶部导航栏 */}
                <NavBar onExtraClick>个人信息</NavBar>

                <List>
                    <List.Item extra={'图片'} onClick={() => { }}>头像</List.Item>
                    <List.Item extra={'13323551400'} onClick={() => { }}>昵称</List.Item>
                    <List.Item extra={'未填写'} onClick={() => { }}>简介</List.Item>
                </List>
                <Space />
                <List>
                    <List.Item extra={'女'} onClick={() => { }}>性别</List.Item>
                    <DatePicker
                        visible={visible}
                        onClose={() => { setVisible(false) }}
                        defaultValue={new Date()}
                        max={new Date()}
                        min={new Date('1900-01-01')}
                        title='时间选择'
                    >
                        {value =>
                            <List.Item
                                extra={value.getFullYear() + '-' + (value.getMonth() + 1) + '-' + value.getDate()}
                                onClick={() => { setVisible(true) }}
                            >生日
                            </List.Item>
                        }
                    </DatePicker>

                </List>
            </div>


        </div>
    )
}
